  @Test
  public void test_Xarch_c() throws Throwable {
    setTestFile("${LLVM_SRC}/llvm/tools/clang/test/Driver/Xarch.c");
    // ${LLVM_SRC}/build/bin/clang -target i386-apple-darwin9 -m32 -Xarch_i386 -O2 ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xarch.c -S -### 2> ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN(TestState.Failed, "%clang -target i386-apple-darwin9 -m32 -Xarch_i386 -O2 %s -S -### 2> %t.log");
    // grep ' "-O2" ' ${TEST_TEMP_DIR}/Xarch.c.tmp.log | ${LLVM_SRC}/build/bin/count 1
    RUN(TestState.Failed, "grep ' \"-O2\" ' %t.log")./*|*/
      I("count 1");
    // ${LLVM_SRC}/build/bin/clang -target i386-apple-darwin9 -m64 -Xarch_i386 -O2 ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xarch.c -S -### 2> ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN("%clang -target i386-apple-darwin9 -m64 -Xarch_i386 -O2 %s -S -### 2> %t.log");
    // grep ' "-O2" ' ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN("not grep ' \"-O2\" ' %t.log");
    // grep "argument unused during compilation: '-Xarch_i386 -O2'" ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN("grep \"argument unused during compilation: '-Xarch_i386 -O2'\" %t.log");
    // ${LLVM_SRC}/build/bin/clang -target i386-apple-darwin9 -m32 -Xarch_i386 -o -Xarch_i386 -S ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xarch.c -S -Xarch_i386 -o 2> ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN("not %clang -target i386-apple-darwin9 -m32 -Xarch_i386 -o -Xarch_i386 -S %s -S -Xarch_i386 -o 2> %t.log");
    // grep "error: invalid Xarch argument: '-Xarch_i386 -o'" ${TEST_TEMP_DIR}/Xarch.c.tmp.log | ${LLVM_SRC}/build/bin/count 2
    RUN(TestState.Failed, "grep \"error: invalid Xarch argument: '-Xarch_i386 -o'\" %t.log")./*|*/
      I("count 2");
    // grep "error: invalid Xarch argument: '-Xarch_i386 -S'" ${TEST_TEMP_DIR}/Xarch.c.tmp.log
    RUN("grep \"error: invalid Xarch argument: '-Xarch_i386 -S'\" %t.log");
  }

  @Test
  public void test_Xlinker_args_c() throws Throwable {
    setTestFile("${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c");
    // ${LLVM_SRC}/build/bin/clang -target i386-apple-darwin9 -### -Xlinker one -Xlinker --no-demangle -Wl,two,--no-demangle,three -Xlinker four -z five -r ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c 2> ${TEST_TEMP_DIR}/Xlinker-args.c.tmp
    RUN("%clang -target i386-apple-darwin9 -### -Xlinker one -Xlinker --no-demangle -Wl,two,--no-demangle,three -Xlinker four -z five -r %s 2> %t");
    // ${LLVM_SRC}/build/bin/FileCheck -check-prefix=DARWIN < ${TEST_TEMP_DIR}/Xlinker-args.c.tmp ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c
    RUN("FileCheck -check-prefix=DARWIN < %t %s");
    // ${LLVM_SRC}/build/bin/clang -target x86_64-pc-linux-gnu -### -Xlinker one -Xlinker --no-demangle -Wl,two,--no-demangle,three -Xlinker four -z five -r ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c 2> ${TEST_TEMP_DIR}/Xlinker-args.c.tmp
    RUN("%clang -target x86_64-pc-linux-gnu -### -Xlinker one -Xlinker --no-demangle -Wl,two,--no-demangle,three -Xlinker four -z five -r %s 2> %t");
    // ${LLVM_SRC}/build/bin/FileCheck -check-prefix=LINUX < ${TEST_TEMP_DIR}/Xlinker-args.c.tmp ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c
    RUN("FileCheck -check-prefix=LINUX < %t %s");
    // ${LLVM_SRC}/build/bin/clang -target i686-pc-win32 -### -Xlinker one -Wl,two ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c 2>&1 | ${LLVM_SRC}/build/bin/FileCheck -check-prefix=WIN ${LLVM_SRC}/llvm/tools/clang/test/Driver/Xlinker-args.c
    RUN("%clang -target i686-pc-win32 -### -Xlinker one -Wl,two %s 2>&1")./*|*/
      I("FileCheck -check-prefix=WIN %s");
  }

