    RUN("echo \"fun:bar\" > %t.second");
    // echo badline > ${TEST_TEMP_DIR}/fsanitize-blacklist.c.tmp.bad
    RUN("echo \"badline\" > %t.bad");
    // ${LLVM_SRC}/build/bin/clang -target x86_64-linux-gnu -fsanitize=address '-fsanitize-blacklist=${TEST_TEMP_DIR}/fsanitize-blacklist.c.tmp.good' '-fsanitize-blacklist=${TEST_TEMP_DIR}/fsanitize-blacklist.c.tmp.second' ${LLVM_SRC}/llvm/tools/clang/test/Driver/fsanitize-blacklist.c -### 2>&1 | ${LLVM_SRC}/build/bin/FileCheck ${LLVM_SRC}/llvm/tools/clang/test/Driver/fsanitize-blacklist.c --check-prefix=CHECK-BLACKLIST
    RUN("%clang -target x86_64-linux-gnu -fsanitize=address -fsanitize-blacklist=%t.good -fsanitize-blacklist=%t.second %s -### 2>&1")./*|*/
      I("FileCheck %s --check-prefix=CHECK-BLACKLIST");
    // ${LLVM_SRC}/build/bin/clang -target x86_64-linux-gnu -fsanitize=address '-fsanitize-blacklist=${TEST_TEMP_DIR}/fsanitize-blacklist.c.tmp.good' '-fsanitize-blacklist=${TEST_TEMP_DIR}/fsanitize-blacklist.c.tmp.second' ${LLVM_SRC}/llvm/tools/clang/test/Driver/fsanitize-blacklist.c -### 2>&1 | ${LLVM_SRC}/build/bin/FileCheck ${LLVM_SRC}/llvm/tools/clang/test/Driver/fsanitize-blacklist.c --check-prefix=CHECK-BLACKLIST2
