      I("FileCheck %s --check-prefix=CHECK-FREEBSD-LD");
    // ${LLVM_SRC}/build/bin/clang ${LLVM_SRC}/llvm/tools/clang/test/Driver/fuse-ld.c -### -fuse-ld=bfd '--sysroot=${LLVM_SRC}/llvm/tools/clang/test/Driver/Inputs/basic_freebsd_tree' -target x86_64-unknown-freebsd '-B${LLVM_SRC}/llvm/tools/clang/test/Driver/Inputs/basic_freebsd_tree/usr/bin' 2>&1 | ${LLVM_SRC}/build/bin/FileCheck ${LLVM_SRC}/llvm/tools/clang/test/Driver/fuse-ld.c -check-prefix=CHECK-FREEBSD-BFD
