  @Test
  public void test_pth_c() throws Throwable {
    setTestFile("${LLVM_SRC}/llvm/tools/clang/test/Driver/pth.c");
    // ${LLVM_SRC}/build/bin/clang -no-canonical-prefixes -ccc-pch-is-pth -x c-header ${LLVM_SRC}/llvm/tools/clang/test/Driver/pth.c -o ${TEST_TEMP_DIR}/pth.c.tmp.h.pth -### 2> ${TEST_TEMP_DIR}/pth.c.tmp.log
    RUN("%clang -no-canonical-prefixes -ccc-pch-is-pth -x c-header %s -o %t.h.pth -### 2> %t.log");
    // ${LLVM_SRC}/build/bin/FileCheck -check-prefix CHECK1 -input-file ${TEST_TEMP_DIR}/pth.c.tmp.log ${LLVM_SRC}/llvm/tools/clang/test/Driver/pth.c
    RUN("FileCheck -check-prefix CHECK1 -input-file %t.log %s");
    // touch ${TEST_TEMP_DIR}/pth.c.tmp.h.pth
    RUN("touch %t.h.pth");
    // ${LLVM_SRC}/build/bin/clang -no-canonical-prefixes -ccc-pch-is-pth -E -include ${TEST_TEMP_DIR}/pth.c.tmp.h ${LLVM_SRC}/llvm/tools/clang/test/Driver/pth.c -### 2> ${TEST_TEMP_DIR}/pth.c.tmp.log
    RUN("%clang -no-canonical-prefixes -ccc-pch-is-pth -E -include %t.h %s -### 2> %t.log");
    // ${LLVM_SRC}/build/bin/FileCheck -check-prefix CHECK2 -input-file ${TEST_TEMP_DIR}/pth.c.tmp.log ${LLVM_SRC}/llvm/tools/clang/test/Driver/pth.c
    RUN("FileCheck -check-prefix CHECK2 -input-file %t.log %s");
  }

